    return (
      <StripeProvider apiKey="pk_test_0u5HEdSaV8pLMOhgg1PhKmVZ00YlBgGg8J">
        <div className="example">
          <h1>React Stripe Elements Example</h1>
          <Elements>
            <CheckoutForm />
          </Elements>
        </div>
      </StripeProvider>
    );
  }
}

export default Checkout;
